define({"topics" : [{"title":"<span class=\"keyword wintitle\">UI Explorer</span> panel\n                  ","shortdesc":"\n                     <p class=\"shortdesc\">Upon startup, the Interface Viewer takes inventory of every open window in the    system on which it is pointed, and displays\n                        each one as a node in its <span class=\"ph uicontrol\">UI     Explorer</span> tree.\n                     </p>\n                  ","id":"concept_myj_pmw_gt","href":"TA_Help\/Topics\/ug_Interface_UI_explorer_panel.html","menu": {"hasChildren":false,},"tocID":"concept_myj_pmw_gt-d46e22694","topics":[]},{"title":"<span class=\"keyword wintitle\">Properties</span> panel\n                  ","shortdesc":"\n                     <p class=\"shortdesc\">The <span class=\"keyword wintitle\">Properties</span> panel displays the properties and property values of   the currently-selected window or control node in the <span class=\"keyword wintitle\">UI Explorer</span> panel. \n                     </p>\n                  ","id":"concept_yt4_pnw_gt","href":"TA_Help\/Topics\/ug_Interface_properties_panel.html","menu": {"hasChildren":false,},"tocID":"concept_yt4_pnw_gt-d46e22710","topics":[]},{"title":"<span class=\"keyword wintitle\">Interface Elements</span> panel\n                  ","shortdesc":"\n                     <p class=\"shortdesc\">The <span class=\"keyword wintitle\">Interface Elements</span> panel displays the interface       elements of the open interface entity.\n                     </p>\n                  ","id":"concept_bbt_24w_gt","href":"TA_Help\/Topics\/ug_Interface_panel.html","menu": {"hasChildren":false,},"tocID":"concept_bbt_24w_gt-d46e22729","topics":[]},{"title":"<span class=\"keyword wintitle\">Properties Comparison</span> panel\n                  ","shortdesc":"\n                     <p class=\"shortdesc\"><span class=\"ph\">This panel displays the differences between the defined property     values in the interface element and the actual (just-captured)\n                           values of those properties in the     corresponding control, allowing you to understand why that interface element is no longer\n                           able     to identify the control.</span></p>\n                  ","id":"concept_fbc_pzb_ht","href":"TA_Help\/Topics\/ug_Inteface_properties_comparison_panel.html","menu": {"hasChildren":false,},"tocID":"concept_fbc_pzb_ht-d46e22745","topics":[]},{"title":"Toolbar","shortdesc":"\n                     <p class=\"shortdesc\">The Interface Viewer incorporates a number of functions into its toolbar.</p>\n                  ","id":"concept_sgb_54w_gt","href":"TA_Help\/Topics\/ug_Interface_viewer_toolbar.html","menu": {"hasChildren":false,},"tocID":"concept_sgb_54w_gt-d46e22761","topics":[]}]});